#!/bin/bash

localNode=$1
if [[ "$localNode" == "" ]]; then
  localNode=1
fi

#Comment out this line to use HTTP connection
connection="--unix-socket qdata/c${localNode}/tm.ipc"

count=0
while [ 1 ]; do
  echo $count
  #Send txn directly to Tessera
  SECONDS=0
  portNum=$((9090 + $localNode))
  hash=`curl ${connection} --request POST --url http://localhost:${portNum}/sendraw --header 'c11n-to: ROAZBWtSacxXQrOe3FGAqJDyJjFePR5ce4TSIzmJ0Bc=' --header 'content-type: application/octet-stream' --data  2>/dev/null`
  echo "Time taken= $SECONDS, Hash=$hash"
done

